import { Jumbotron, Button } from "react-bootstrap";

const MyJumbotron = () => {
  <Jumbotron>
    <h1>Hello, world!</h1>
    <p>Welcome</p>
    <p>
      <Button variant="primary">Learn more</Button>
    </p>
  </Jumbotron>;
};
export default MyJumbotron;
